import { request } from '../utils/core.utils';



export const getAllNotes = id => {

    return request(`${id}/notes`, 'get', null);
}

export const createNote = ({id,formData}) => {
    console.log('here creat Note');

    return request(`${id}/notes/createNote`, 'post', formData);
}
